var app = {
	userAgent : navigator.userAgent,
	init : function(){
		var $this = this;

        // $this.splashScreen = document.createElement("img");
        // $this.splashScreen.src = 'data:image/jpeg;base64,';
        // $this.splashScreen.addEventListener("load", function () {
        //     document.getElementById("loader-page-image").appendChild($this.splashScreen);
        // });
		$this.splashScreen = document.getElementById("loader-page-image");


		if ($this.userAgent.toLowerCase().indexOf('electron/') > -1) { // Si c'est PC
		   // Electron-specific code
		   $this.loadJS("js/init_electron.js", function(id) {},0);
		}
		else if($this.userAgent.match(/(iPhone|iPod|iPad|Android|BlackBerry|IEMobile)/)){ // Si c'est Mobile
		   $this.loadJS("js/init_cordova.js", function(id) {},0);
		}
		else{ // Si c'est WEB
		   $this.loadJS("js/init_web.js", function(id) {},0);
		}
	},
	loadJS: function(src, callback,id) {
        var $this = this;
        
        var script = document.createElement('script'),
            loaded;
        //script.setAttribute('src', src);
        if(src)
            script.src = src;
        if (callback) {
            script.onreadystatechange = script.onload = function() {
                
                if (!loaded) {
                  callback(id);
                }
                loaded = true;
            };

            script.onreadystatechange = script.onerror = function() {
                if(src)
                $this.logError("<i class=\"fa fa-meh-o\" aria-hidden=\"true\" style=\"color:#FFB5B3\"></i> Erreur de chargement survenue - js/css");
            };

        }//alert(script.src);
        document.getElementsByTagName('head')[0].appendChild(script);
        
    }

}


app.init();